import React from 'react';
import { Routes, Router } from 'react-router-dom';
import Explores from '../views/Explores';

const Content = () => {
    return (
        <main>

            <Routes>
                <Router path='/explore' element={<Explores />}></Router>
            </Routes>
        </main>
    );
};

export default Content;
